import React from "react";
import GoogleMapReact from "google-map-react";
import { Container } from "react-bootstrap";

function Map({ center, zoom, locations }) {
  const Marker = ({ lat, lng }) => (
    <div style={{ color: "red", fontSize: "24px" }}>üìç</div>
  );

  return (
    <div  style={{ height: "60%", width: "60%",margin:"auto",backgroundColor:"gray",borderRadius:"5vh" }}>
      <Container className="d-flex justify-content-center align-items-center py-4 px-0 my-1">
        <div style={{ height: "100vh", width: "90%" }}>
          <GoogleMapReact center={center} zoom={zoom}>
            {locations.map(({ lat, lng }, index) => (
              <Marker key={index} lat={lat} lng={lng} />
            ))}
          </GoogleMapReact>
        </div>
      </Container>
    </div>
  );
}

export default Map;
